ive interface for managing a collection of attachments. Most settings are similar to the Image field type. Additional settings allow you to specify where new attachments are added in the gallery and the minimum/maximum number of attachments allowed.'=>'Интерактивный интерфейс для управления коллекцией вложений. Большинство настроек аналогично типу поля «Изображение». Дополнительные настройки позволяют указать место добавления новых вложений в галерею и мин/макс количество вложений.','This provides a simple, structured, layout-based editor. The Flexible Content field allows you to define, create and manage content with total control by using layouts and subfields to design the available blocks.'=>'Обеспечивает простой, структурированный редактор на основе макетов. Поле «Гибкое содержимое» позволяет создавать и управлять содержимым с полным контролем, используя макеты и вложенные поля для оформления доступных блоков.','This allows you to select and display existing fields. It does not duplicate any fields in the database, but loads and displays the selected fields at run-time. The Clone field can either replace itself with the selected fields or display the selected fields as a group of subfields.'=>'Позволяет выбирать и отображать существующие поля. Он не дублирует поля в базе данных, а загружает и отображает выбранные поля во время выполнения программы. Поле Дубликатор может либо заменять собой выбранные поля, либо отображать выбранные поля в виде группы вложенных полей.','nounClone'=>'Дубликатор','Validation'=>'Проверка','Layout'=>'Макет','Advanced'=>'Дополнительные','Relational'=>'Зависимые','Choice'=>'Выбор','Content'=>'Содержимое','Basic'=>'Основные','Unknown'=>'Неизвестно','Field type does not exist'=>'Тип поля не существует','JSON Load Paths'=>'Путей загрузки JSON','JSON Save Paths'=>'Путей сохранения JSON','Registered SCF Forms'=>'Зарегистрировано форм SCF','Shortcode Enabled'=>'Шорткод включен','Field Settings Tabs Enabled'=>'Вкладки настроек поля включены'