 журнал и закройте уведомление%2$s после экранирования значений в вашем коде. Уведомление появится снова, если мы снова обнаружим измененные значения.','%1$s (%2$s) - rendered via %3$s'=>'%1$s (%2$s) - отрисовано через %3$s','%1$s SCF automatically escapes unsafe HTML when rendered by <code>the_field</code> or the ACF shortcode. We\'ve detected the output of some of your fields has been modified by this change, but this may not be a breaking change.'=>'%1$s SCF автоматически экранирует небезопасный HTML при выводе с помощью <code>the_field</code> или шорткода ACF. Мы обнаружили, что вывод некоторых ваших полей был модифицирован этим действием, но это изменение не может быть значительным.','Please contact your site administrator or developer for more details.'=>'Для получения более подробной информации обратитесь к администратору сайта или разработчику.','Dismiss permanently'=>'Отклонить навсегда','Select Field'=>'Выбрать поле','Try a different search term or browse %s'=>'Попробуйте другой поисковый запрос или просмотрите %s','Popular fields'=>'Популярные поля','No search results for \'%s\''=>'Нет результатов поиска для "%s"','Search fields...'=>'Поиск полей...','Select Field Type'=>'Выбрать тип поля','Popular'=>'Популярные','Add Taxonomy'=>'Добавить таксономию','Create custom taxonomies to classify post type content'=>'Создавайте пользовательские таксономии для классификации содержимого типов записей','Add Your First Taxonomy'=>'Добавьте вашу первую таксономию','Hierarchical taxonomies can have descendants (like categories).'=>'Древовидные таксономии могут иметь потомков (по типу Рубрик).','Makes a taxonomy visible on the frontend and in the admin dashboard.'=>'Сделать таксономию видимой для сайта и панели администратора.','One or many post types that can be classified with this taxonomy.'=>'Один или несколько типов записей, которые можно классифицировать с помощью данной таксономии.','genre'=>'жанр','Lower case letters, underscores and dashes only, Max 32 characters.'=>'Только буквы нижнего регистра, подчеркивания и тире, максимум 32 символа.','Genre'=>'Жанр','Genres'=>'Жанры','Optional custom controller to use instead of `WP_REST_Terms_Controller `.'=>'Пользовательский контроллер для использования вместо `WP_REST_Terms_Controller`.','Expose this post type in the REST API.'=>'Представить этот тип записей в REST API.','The capability name for assigning terms of this taxonomy.'=>'Название прав доступа для назначения терминов этой таксономии.','Assign Terms Capability'=>'Права для назначения терминов','The capability name for deleting terms of this taxonomy.'=>'Название прав доступа для удаления терминов этой таксономии.','Delete Terms Capability'=>'Права для удаления терминов','The capability name for editing terms of this taxonomy.'=>'Название прав доступа для редактирования терминов этой таксономии.','Edit Terms Capability'=>'Права для редактирования терминов','The capability name for managing terms of this taxonomy.'=>'Название прав доступа для управления терминами этой таксономии.','Manage Terms Capability'=>'Права для управления терминами','Customize the query variable name'=>'Настройте значение переменной запроса.','Terms can be accessed using the non-pretty permalink, e.g., {query_var}={term_slug}.'=>'Доступ к терминам можно получить, используя некрасивую постоянную ссылку, например {query_var}={term_slug}.','Parent-child terms in URLs for hierarchical taxonomies.'=>'Термины «родитель-ребенок» в URL для древовидных таксономий.','Customize the slug used in the URL'=>'Настроить ярлык, используемый в URL','Permalinks for this taxonomy are disabled.'=>'Постоянные ссылки для этой таксономии отключены.','Rewrite the URL using the taxonomy key as the slug. Your permalink structure will be'=>'Перепишите URL, используя ключ таксономии в качестве ярлыка. Ваша структура постоянных ссылок будет выглядеть следующим образом','Taxonomy Key'=>'Ключ таксономии','Select the type of permalink to use for this taxonomy.'=>'Выберите тип постоянной ссылки для этой таксономии.','Display a column for the taxonomy on post type listing screens.'=>'Отображать колонку таксономии на страницах списков типа записей.','Show Admin Column'=>'Отображать столбец администратора','Show the taxonomy in the quick/bulk edit panel.'=>'Отображать таксономию в панели быстрого/массового редактирования.','Quick Edit'=>'Быстрая правка','List the taxonomy in the Tag Cloud Widget controls.'=>'Выводит таксономию в управлении виджета Облака меток.','Tag Cloud'=>'Облако меток','A PHP function name to be called for sanitizing taxonomy data saved from a meta box.'=>'Имя PHP-функции, вызываемой для очистки данных таксономии, сохраненных из метабокса.','Meta Box Sanitization Callback'=>'Колбэк-функция очистки данных метабокса','A PHP function name to be called to handle the content of a meta box on your taxonomy. For security, this callback will be executed in a special context without access to any superglobals like $_POST or $_GET.'=>'Имя PHP функции, которая будет вызвана для обработки содержимого метабокса вашей таксономии. В целях безопасности вызов этой функции будет выполняться в специальном контексте без доступа к каким-либо глобальным переменным, таким как $_POST или $_GET.','Register Meta Box Callback'=>'Регистрация колбэк-функции метабокса','No Meta Box'=>'Без метабокса','Custom Meta Box'=>'Пользовательский метабокс','Controls the meta box on the content editor screen. By default, the Categories meta box is shown for hierarchical taxonomies, and the Tags meta box is shown for non-hierarchical taxonomies.'=>'Управляет метабоксом на странице редактирования. По умолчанию для древовидных таксономий отображается метабокс Рубрики, а для недревовидных - метабокс Метки.','Meta Box'=>'Метабокс','Categories Meta Box'=>'Метабокс Рубрик','Tags Meta Box'=>'Метабокс Меток','A link to a tag'=>'Ссылка на метку','Describes a navigation link block variation used in the block editor.'=>'Описывает вариацию блока навигационных ссылок, используемому в редакторе блоков.','A link to a %s'=>'Ссылка на %s','Tag Link'=>'Ссылка метки','Assigns a title for navigation link block variation used in the block editor.'=>'Назначает заголовок вариации блока навигационных ссылок, используемому в редакторе блоков.','← Go to tags'=>'← Перейти к меткам','Assigns the text used to link back to the main index after updating a term.'=>'Назначает текст, используемый для обратной ссылки на основной индекс после обновления термина.','Back To Items'=>'Перейти к элементам','← Go to %s'=>'← Перейти к %s','Tags list'=>'Список меток','Assigns text to the table hidden heading.'=>'Назначает текст скрытому заголовку таблицы.','Tags list navigation'=>'Навигация по списку меток','Assigns text to the table pagination hidden heading.'=>'Назначает текст скрытому заголовку таблицы пагинации.','Filter by category'=>'Фильтр по рубрике','Assigns text to the filter button in the posts lists table.'=>'Назначает текст для кнопки фильтрации в таблице списков записей.','Filter By Item'=>'Фильтр по элементу','Filter by %s'=>'Фильтр по %s','The description is not prominent by default; however, some themes may show it.'=>'Описание по умолчанию не отображается, однако некоторые темы могут его показывать.','Describes the Description field on the Edit Tags screen.'=>'Описывает поле «Описание» на странице редактирования меток.','Description Field Description'=>'Описание поля описания','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band'=>'Назначьте родительский термин для создания иерархии. Термин "Джаз", например, будет родителем для "Бибопа" и "Биг-бэнда".','Describes the Parent field on the Edit Tags screen.'=>'Описывает поле «Родитель» на странице редактирования меток.','Parent Field Description'=>'Описание родительского поля','The "slug" is the URL-friendly version of the name. It is usually all lower case and contains only letters, numbers, and hyphens.'=>'«Ярлык» — это вариант названия, подходящий для URL. Обычно содержит только латинские буквы в нижнем регистре, цифры и дефисы.','Describes the Slug field on the Edit Tags screen.'=>'Описывает поле «Ярлык» на странице редактирования меток.','Slug Field Description'=>'Ярлык описания поля','The name is how it appears on your site'=>'Название определяет, как элемент будет отображаться на вашем сайте','Describes the Name field on the Edit Tags screen.'=>'Описывает поле «Название» на странице редактирования меток.','Name Field Description'=>'Описание имени поля','No tags'=>'Меток нет','Assigns the text displayed in the posts and media list tables when no tags or categories are available.'=>'Назначает текст, отображаемый в списках записей и медиафайлов при отсутствии меток и категорий.','No Terms'=>'Нет терминов','No %s'=>'Нет %s','No tags found'=>'Меток не найдено','Assigns the text displayed when clicking the \'choose from most used\' text in the taxonomy meta box when no tags are available, and assigns the text used in the terms list table when there are no items for a taxonomy.'=>'Назначает текст, отображаемый при нажатии на кнопку «выбрать из часто используемых» в метабоксе таксономии, если метки отсутствуют, и назначает текст, используемый в таблице списка терминов, если для таксономии нет элементов.','Not Found'=>'Не найдено','Assigns text to the Title field of the Most Used tab.'=>'Назначает текст поля "Заголовок" вкладки "Часто используемые".','Most Used'=>'Часто используемые','Choose from the most used tags'=>'Выбрать из часто используемых меток','Assigns the \'choose from most used\' text used in the meta box when JavaScript is disabled. Only used on non-hierarchical taxonomies.'=>'Назначает текст «выбрать из наиболее используемых», используемый в метабоксе, когда JavaScript отключен. Используется только для неиерархических таксономий.','Choose From Most Used'=>'Выбрать из часто используемых','Choose from the most used %s'=>'Выбрать из часто используемых %s','Add or remove tags'=>'Добавить или удалить метки','Assigns the add or remove items text used in the meta box when JavaScript is disabled. Only used on non-hierarchical taxonomies'=>'Назначает текст добавления или удаления элементов, используемый в метабоксе, когда JavaScript отключен. Используется только для неиерархических таксономий','Add Or Remove Items'=>'Добавить или удалить элементы','Add or remove %s'=>'Добавить или удалить %s','Separate tags with commas'=>'Разделите метки запятыми','Assigns the separate item with commas text used in the taxonomy meta box. Only used on non-hierarchical taxonomies.'=>'Назначает текст разделителя через запятую, используемый в метабоксе таксономии. Используется только для неиерархических таксономий.','Separate Items With Commas'=>'Разделите элементы запятыми','Separate %s with commas'=>'Разделите %s запятыми','Popular Tags'=>'Популярные метки','Assigns popular items text. Only used for non-hierarchical taxonomies.'=>'Назначает текст популярных элементов.','Popular Items'=>'Популярные элементы','Popular %s'=>'Популярные %s','Search Tags'=>'Поиск меток','Assigns search items text.'=>'Назначает текст элементов поиска.','Parent Category:'=>'Родительская рубрика:','Assigns parent item text, but with a colon (:) added to the end.'=>'Назначает текст родительского элемента, но с двоеточием (:) на конце.','Parent Item With Colon'=>'Родительский элемент через двоеточие','Parent Category'=>'Родительская рубрика','Assigns parent item text. Only used on hierarchical taxonomies.'=>'Назначает текст родительского элемента. Используется только для древовидных таксономий.','Parent Item'=>'Родительский элемент','Parent %s'=>'Родитель %s','New Tag Name'=>'Название новой метки','Assigns the new item name text.'=>'Назначает текст названия нового элемента.','New Item Name'=>'Название нового элемента','New %s Name'=>'Название новой %s','Add New Tag'=>'Добавить метку','Assigns the add new item text.'=>'Назначает текст добавления элемента.','Update Tag'=>'Обновить метку','Assigns the update item text.'=>'Назначает текст обновления элемента.','Update Item'=>'Обновить элемент','Update %s'=>'Обновить %s','View Tag'=>'Просмотреть метку','In the admin bar to view term during editing.'=>'На панели администратора для просмотра термина при его редактировании.','Edit Tag'=>'Редактировать метку','At the top of the editor screen when editing a term.'=>'Сверху страницы редактирования при изменении термина.','All Tags'=>'Все метки','Assigns the all items text.'=>'Назначает текст всех элементов.','Assigns the menu name text.'=>'Назначает текст названия меню.','Menu Label'=>'Ярлык меню','Active taxonomies are enabled and registered with WordPress.'=>'Активные таксономии включены и регистрируются в WordPress.','A descriptive summary of the taxonomy.'=>'Описание таксономии.','A descriptive summary of the term.'=>'Описание термина.','Term Description'=>'Описание термина','Single word, no spaces. Underscores and dashes allowed.'=>'Одно слово, без пробелов. Подчеркивания и тире разрешены.','Term Slug'=>'Ярлык термина','The name of the default term.'=>'Название термина по умолчанию.','Term Name'=>'Название термина','Create a term for the taxonomy that cannot be deleted. It will not be selected for posts by default.'=>'Создать термин для таксономии, который не может быть удален. Он будет выбран по умолчанию для записей.','Default Term'=>'Термин по умолчанию','Whether terms in this taxonomy should be sorted in the order they are provided to `wp_set_object_terms()`.'=>'Должны ли термины в этой таксономии сортироваться в том порядке, в котором они представлены в `wp_set_object_terms()`.','Sort Terms'=>'Сортировать термины','Add Post Type'=>'Добавить тип записей','Expand the functionality of WordPress beyond standard posts and pages with custom post types.'=>'Расширьте функциональность WordPress за пределы стандартных записей и страниц с помощью пользовательских типов записей.','Add Your First Post Type'=>'Добавьте ваш первый тип записей','I know what I\'m doing, show me all the options.'=>'Я знаю, что делаю, покажите мне все настройки.','Advanced Configuration'=>'Продвинутая конфигурация','Hierarchical post types can have descendants (like pages).'=>'Древовидные типы записей могут иметь потомков (по типу Страниц).','Hierarchical'=>'Древовидный','Visible on the frontend and in the admin dashboard.'=>'Виден на сайте и в панели администратора.','Public'=>'Публичный','Select existing taxonomies to classify items of the post type.'=>'Выберите существующие таксономии для классификации элементов типа записей.','movie'=>'movie','Lower case letters, underscores and dashes only, Max 20 characters.'=>'Только буквы нижнего регистра, подчеркивания и тире, максимум 20 символов.','Movie'=>'Фильм','Singular Label'=>'Этикетка в единственном числе','Movies'=>'Фильмы','Plural Label'=>'Этикетка во множественном числе','Optional custom controller to use instead of `WP_REST_Posts_Controller`.'=>'Опциональный произвольный контроллер, который будет использоваться вместо `WP_REST_Posts_Controller`.','Controller Class'=>'Класс контроллера','The namespace part of the REST API URL.'=>'Часть пространства имен в URL-адресе REST API.','Namespace Route'=>'Пространство имен маршрута','The base URL for the post type REST API URLs.'=>'Базовый URL-адрес для URL-адресов REST API типа записей.','Base URL'=>'Базовый URL','Exposes this post type in the REST API. Required to use the block editor.'=>'Передает этот тип записей в REST API. Требуется для использования редактора блоков.','Show In REST API'=>'Включить в REST API','Customize the query variable name.'=>'Настройте имя переменной запроса.','Query Variable'=>'Переменная запроса','No Query Variable Support'=>'Без поддержки переменных запроса','Custom Query Variable'=>'Произвольная переменная запроса','Items can be accessed using the non-pretty permalink, eg. {post_type}={post_slug}.'=>'Доступ к элементам можно получить, используя некрасивую постоянную ссылку, например {post_type}={post_slug}.','Query Variable Support'=>'Поддержка переменных запроса','URLs for an item and items can be accessed with a query string.'=>'URL-адреса элемента и элементов можно получить с помощью строки запроса.','Publicly Queryable'=>'Публично запрашиваемый','Custom slug for the Archive URL.'=>'Пользовательский ярлык для URL-адреса архива.','Archive Slug'=>'Ярлык архива','Has an item archive that can be customized with an archive template file in your theme.'=>'Имеет архив записей, который может быть настроен с помощью файла шаблона архива вашей темы.','Archive'=>'Архив','Pagination support for the items URLs such as the archives.'=>'Поддержка пагинации для URL элементов, таких как архивы.','Pagination'=>'Разделение на страницы','RSS feed URL for the post type items.'=>'URL-адрес RSS-канала для элементов типа записей.','Feed URL'=>'URL фида','Alters the permalink structure to add the `WP_Rewrite::$front` prefix to URLs.'=>'Изменяет структуру постоянных ссылок, добавляя префикс `WP_Rewrite::$front` к URL-адресам.','Front URL Prefix'=>'Общий префикс URL','Customize the slug used in the URL.'=>'Настройте ярлык, используемый в URL.','URL Slug'=>'Ярлык URL','Permalinks for this post type are disabled.'=>'Постоянные ссылки для этого типа записей отключены.','Rewrite the URL using a custom slug defined in the input below. Your permalink structure will be'=>'Перепишите URL, используя пользовательский ярлык, заданный в поле ниже. Ваша структура постоянных ссылок будет выглядеть следующим образом','No Permalink (prevent URL rewriting)'=>'Без постоянный ссылки (предотвращает перезапись URL)','Custom Permalink'=>'Произвольная постоянная ссылка','Post Type Key'=>'Ключ типа записей','Rewrite the URL using the post type key as the slug. Your permalink structure will be'=>'Перезаписывает URL, используя ключ типа записей в качестве ярлыка. Структура вашей постоянной ссылки будет','Permalink Rewrite'=>'Перезапись постоянной ссылки','Delete items by a user when that user is deleted.'=>'Удалять элементы пользователя, при его удалении.','Delete With User'=>'Удалять вместе с пользователем','Allow the post type to be exported from \'Tools\' > \'Export\'.'=>'Разрешить экспорт типа записей из «Инструменты» > «Экспорт».','Can Export'=>'Можно экспортировать','Optionally provide a plural to be used in capabilities.'=>'При необходимости укажите множественное число, которое будет использоваться в правах доступа.','Plural Capability Name'=>'Название прав доступа во множественном числе','Choose another post type to base the capabilities for this post type.'=>'Выберите другой тип записей, чтобы использовать возможности этого типа записей.','Singular Capability Name'=>'Название прав доступа в единственном числе','By default the capabilities of the post type will inherit the \'Post\' capability names, eg. edit_post, delete_posts. Enable to use post type specific capabilities, eg. edit_{singular}, delete_{plural}.'=>'По умолчанию права доступа типа записей наследуют названия прав доступа у "Запись", например, edit_post, delete_posts. Включите, чтобы использовать характерные названия для типа записей, например edit_{ед_число}, delete_{множ_число}.','Rename Capabilities'=>'Переименовать права доступа','Sets whether posts should be excluded from search results and taxonomy archive pages.'=>'Устанавливает, должны ли записи быть исключены из результатов поиска и страниц архива таксономии.','Exclude From Search'=>'Исключить из поиска','Allow items to be added to menus in the \'Appearance\' > \'Menus\' screen. Must be turned on in \'Screen options\'.'=>'Разрешить добавлять элементы в меню «Внешний вид» > «Меню». Должно быть включено в «Настройках экрана».','Appearance Menus Support'=>'Отображать в меню "Внешний вид"','Appears as an item in the \'New\' menu in the admin bar.'=>'Появляется как пункт в меню "Добавить" на панели администратора.','Show In Admin Bar'=>'Включить в панель администратора','A PHP function name to be called when setting up the meta boxes for the edit screen. For security, this callback will